UnsupportedNamespace = Namnerommet «%S» er ikkje støtta. Bruk «http://www.mozilla.org/2002/soap/security».
UnknownRootElement = Rotelementet «%S» vart ikkje gjenkjent. Bruk «webScriptAccess»-elementet.
UnknownElement = Elementet «%S» vart ikkje gjenkjent.
UnknownAttribute = Attributten «%S» vart ikkje gjenkjent.
TooManyElements = Det kan ikkje vere meir enn eitt «%S»-element.
ElementHasSibling = \u00AB%S\u00BB-elementet kan ikkje ha «%S»-sysken.
ElementNotEmpty = «%S»-elementet burde vere tomt.
SOAPFault = SOAP { %S } %S -kall resulterte i feil: { %S } %S : %S.

